import React, { Component } from 'react';

export default class InputCheckbox extends Component {
  render() {
    const { type, label, id, dataTest, checked, onChange } = this.props;

    return (
      <label htmlFor={ id }>

        <input
          type={ type }
          id={ id }
          data-testid={ dataTest }
          checked={ checked }
          onChange={ onChange }
        />
        { label }
      </label>
    );
  }
}
